						<p class="u-anim -parent -delay-4">Bayswater is a brand of beautifully designed bathrooms
							two ranges of Victorian and Edwardian porcelain, brassware, furniture and fittings. Bayswater is inspired by an era of unmatched inventiveness and creativity. The Victorian period was a veritable explosion of new ideas and pioneering innovation. Its no wonder that Victorian style bathrooms are still loved one hundred and fifty years later. Bayswater builds on this tradition by bringing these established aesthetic values and contemporary designs together. The result is a range of porcelain, brassware, furniture and fittings that have never been seen before.</p>
